import fetch from 'isomorphic-unfetch';
import { authHeader, handleResponse } from "../_helpers";

const target = `https://intim-vibe-api.padilo.pro/api`;

export const adminService = {
  registration
};

async function registration(name, password, email, password_confirmation) {
  const requestOptions = {
    method: "POST",
    headers: authHeader(),
    body: JSON.stringify({
      name,
      password,
      email,
      password_confirmation
    })
  };

  return await fetch(`${target}/admin/register`, requestOptions)
    .then(handleResponse);
}
